import React from "react";
import { Container,Row,Col } from "react-bootstrap";
import Catigories from "./Catigories";

const CatigoriesList = ({category}) => {
    return(
        <Row className="mt-3">
           {
            category.map((cat)=>{
                return(
                    <Catigories cat={cat} key={cat.idCategory} />
                )
            })
           }
        </Row>
    )
}
export default CatigoriesList;
